テトラの外掛け式フィルター（OTシリーズ・ATシリーズ）の吸い込み口に取り付けOK。<br>
最初にゴミをキャッチします。<br>また、稚魚やエビなどがフィルター内に吸い込まれないようにガードする役割もします。<br><Br>
【関連フィルター】<Br>
・テトラ　オートワンタッチフィルター　AT-20 
 <br>
・テトラ　オートワンタッチフィルター　AT-30 
